import React from 'react';
import './Card.css';

const Card = (props) => {

    return (
        <div className='wrapper'>
            <li>id:{props.id}</li>
            <h1>name:{props.name}</h1>
            <h1>date:{props.date}</h1>
        </div>
    );
};

export default Card;
